import FormSelect from '../components/select'

import styled from 'styled-components'
import '../styles/theme.css'

function FilterApps() {
  const AppOptions = [
    { value: 'app1', label: 'App 1' },
    { value: 'app2', label: 'App 2' },
    { value: 'app3', label: 'App 3' }
  ]

  const EnvOptions = [
    { value: 'all', label: 'All Env' },
    { value: 'prod', label: 'prod' },
    { value: 'stag', label: 'stag' },
  ]

  const DateOptions = [
    { value: '24h', label: '24h' },
    { value: '14d', label: '14d' },
  ]

  return (
    <FilterAppsStyles>
      <FormSelect 
        defaultValue={AppOptions[0]}
        options={AppOptions}
      />
      <FormSelect 
        defaultValue={EnvOptions[0]}
        options={EnvOptions}
      />
      <FormSelect 
        defaultValue={DateOptions[0]}
        options={DateOptions}
      />
    </FilterAppsStyles>
  )
}

const FilterAppsStyles = styled('div')`
  display: flex;
`;



export default FilterApps;
